<template>
  <view class="welcome_">
    <view class="wz"></view>
    <view class="wz2"></view>
    <view class="wz3"></view>
    <view class="paonan"></view>
  </view>
</template>

<script>
export default {
  data() {
    return {};
  },
  onLoad() {
    //清理缓存
    try {
      uni.clearStorageSync();
      uni.clearStorage();
    } catch (e) {}
    setTimeout(() => {
      this.getsession();
    }, 1500);
  },
  mounted() {
    // uni.switchTab({
    //   url: "/pages/index/index"
    // });
    // 选择学校
    // uni.redirectTo({
    //     url: '/pages/school/xuanzheschool'
    // });
  },
  methods: {
    //发送code给后端，验证openid  验证是否记录了个人信息
    login() {
      let thiz = this;
      uni.login({
        provider: "weixin",
        success(loginRes) {
          let code = loginRes.code;
          uni.request({
            method: "GET",
            url: thiz.myconfig.url + "index.php/home/xlogin/get_user_object",
            data: {
              code
            },
            header: {
              "content-type": "application/x-www-form-urlencoded;charset=utf-8",
              Cookie: uni.getStorageSync("sessionid")
            },
            success: res => {
              //保存加密后的openid
              uni.setStorageSync("md5openid", res.data.openid);
              //缓存userinfo信息
              uni.setStorageSync("userinfo", res.data.userinfo);
              //获取到了值，然后跳转
              if (thiz.myconfig.isnull(res.data.openid)) {
                uni.showToast({
                  title: "登陆失败",
                  duration: 2000,
                  icon: "none"
                });
              } else {
                if (!thiz.myconfig.isnull(res.data.district)) {
                  uni.setStorageSync("district", res.data.district);
                }
                if (!thiz.myconfig.isnull(res.data.city)) {
                  uni.setStorageSync("city", res.data.city);
                }
                if (!thiz.myconfig.isnull(res.data.school_id)) {
                  if (!thiz.myconfig.isnull(res.data.school_id)) {
                    uni.setStorageSync("school_id", res.data.school_id);
                  }
                  uni.reLaunch({
                    url: "/pages/index/index"
                  });
                } else {
                  uni.reLaunch({
                    url: "/pages/school/xuanzheschool"
                  });
                }
              }
            }
          });
        },
        fail() {
          uni.showToast({
            title: "登陆失败",
            icon: "none",
            duration: 1400,
            position: "top"
          });
        }
      });
    },
    //后台获取登陆会话
    getsession() {
      uni.request({
        url: this.myconfig.url + "index.php/home/xlogin/sess",
        data: {},
        header: {
          "content-type": "application/x-www-form-urlencoded;charset=utf-8"
        },
        success: res => {
          if (res.data.result) {
            //把sessioncookie加入缓存
            uni.setStorageSync("sessionid", res.header["Set-Cookie"]);
            try {
              const value = uni.getStorageSync("sessionid");
              if (value) {
                //获取openid登陆
                this.login();
              }
            } catch (e) {
              uni.showToast({
                title: "系统错误",
                duration: 2000,
                icon: "none"
              });
            }
          }
        }
      });
    }
  }
};
</script>

